  public static boolean run(DriveTrain drivetrain, IntakeSubsystem intake, ShooterSubsystem shooter, int index) {
    if (index >= speeds.length) return false;

    drivetrain.drive(speeds[index][0], speeds[index][1]);

    if (speeds[index][5] == 1.0) {
      intake.setSpeed1(-0.05);
    } else {
      intake.setSpeed1(speeds[index][2]);
    }
    
    if (speeds[index][5] == 1.0 && speeds[index][6] == 1.0) {
      intake.setSpeed2(-0.05);
    } else {
      intake.setSpeed2(speeds[index][3]);
    }

    shooter.setSpeed(speeds[index][4]);

    return true;
  }
